import React from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar.jsx';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Importing default exports
import Home from './components/Home/Home.jsx';
import AddLawyer from './pages/AddLawyer.jsx';
import AdminDashboard from './components/Admin/AdminDashboard.jsx';
import ForgetPassword from './pages/ForgetPassword.jsx';
import Registration from './pages/registrationsPage.jsx';
import Login from './pages/LoginPages.jsx';
import Header from './components/Header/Header.jsx';
import AboutUs from './components/AboutUs/AboutUs.jsx';
import Footer from './components/Footer/Footer.jsx';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Header/>
        <AboutUs/>
        <Home/>
        <Footer/>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/lawyers" element={<LawyersAdvocates />} />
          <Route path="/add-lawyer" element={<AddLawyer />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/admin-login" element={<AdminLogin />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
